%legend('曲线','波谷点','波峰点')
hold off;


if length(IndMin_all) > length(IndMax_all)
    %ind_max_num=length(IndMin_all);
    IndMax_all(length(IndMax_all):length(IndMin_all)) = 1;
else
    %ind_max_num=length(IndMax_all);
    IndMin_all(length(IndMin_all):length(IndMax_all)) = 1;
end

%排除加速度超标的
j=1;
IndMax=[];
IndMin=[];
for i=1:length(IndMax_all)
    if sF(IndMax_all(i)) < dis_max && sF(IndMax_all(i)) > dis_min
        IndMax(j) = IndMax_all(i);
        IndMin(j) = IndMin_all(i);
        j = j+1;
    end
end

if length(IndMax) < 10
    subplot(212)
    plot(1:length(sF),sF);
    fprintf('\n算法2测量步数: 0\n');
else

    subplot(212)
    plot(1:length(sF),sF);
    hold on

    %排除峰峰值太小的
    j=1;
    %step_value=[10];
    %step_value_p(j) = sF(IndMax(1));
    %step_num_p(j) = IndMax(1);
    %j = j+1;
    for i=2:length(IndMax)
        if sF(IndMax(i)) - sF(IndMin(i-1)) > peak_max
        elseif sF(IndMax(i)) - sF(IndMin(i-1)) < peak_min
        else
 %           step_value_p(j) = sF(IndMax(i));
            step_num_p(j) = IndMax(i);
            j = j+1;
        end
    end

    %排除频率太高和太低
    j=1;
%    step_value(j) = sF(step_num_p(1));
    step_num(j) = step_num_p(1);
    for i=2:length(step_num_p)
        if step_num_p(i) - step_num_p(i-1) > time_max
        elseif step_num_p(i) - step_num_p(i-1) < time_min && step_num_p(i) - step_num(j) < time_min
        elseif step_num_p(i) - step_num_p(i-1) < time_min && step_num_p(i) - step_num(j) > time_max
        else
            j = j+1;
            step_value(j) = sF(step_num_p(i));
            step_num(j) = step_num_p(i);   
        end
    end

    plot(step_num_p, sF(step_num_p), 'b+');
    plot(step_num, sF(step_num), 'r*');
    hold off

    fprintf('\n算法2测量步数: %d\n', length(step_value));
end
